digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Complex Router</b></font></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="logLevel__key" align="left" balign="left">logLevel</td><td port="logLevel__value" align="left" balign="left">debug</td></tr><tr><td port="maxSteps__key" align="left" balign="left">maxSteps</td><td port="maxSteps__value" align="left" balign="left">20</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>start</b></td></tr><tr><td align="left">Initial routing decision</td></tr><tr><td align="left"><font point-size="8" color="#666666">→ Make initial routing decision based on input analysis</font></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L6:0-8:1"];
  "checkpoint1" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>checkpoint1</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Second routing decision</td></tr><tr><td align="left"><font point-size="8" color="#666666">→ Evaluate intermediate results and choose next step</font></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L10:0-12:1"];
  "success" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>success</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Success path</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L14:0-14:28"];
  "alternate" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>alternate</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Alternate path</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L15:0-15:32"];
  "end" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>end</b></td></tr><tr><td align="left">Final state</td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000", URL="#L16:0-16:17"];

  // Edges
  "start" -> "checkpoint1" [labelOverlay="75%", edgeURL="#L19:6-19:20"];
  "start" -> "alternate" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>direct_alternate</b></td></tr></table>>, labelOverlay="75%", edgeURL="#L20:6-20:37"];
  "checkpoint1" -> "success" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>proceed_success</b></td></tr></table>>, labelOverlay="75%", edgeURL="#L21:12-21:40"];
  "checkpoint1" -> "alternate" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2" align="left"><tr><td align="left" balign="left"><b>fallback_alternate</b></td></tr></table>>, labelOverlay="75%", edgeURL="#L22:12-22:45"];
  "success" -> "end" [labelOverlay="75%", edgeURL="#L23:8-23:14"];
  "alternate" -> "end" [labelOverlay="75%", edgeURL="#L24:10-24:16"];
}
